  true,\n\t\"url\": null,\n\t\"notes\": \"The E3 Portfolio Review Database houses
  operational and performance data for all activities that the Bureau funds and/or
  manages. Activity-level data is collected by three input forms: the Activity Input
  Form, is required for all activities and contains basic descriptive and financial
  data for each activity. The second form, Award Input Form, contains additional questions
  for activities that have awardees. The third form, User Guide Input Form, asks for
  information about activities that should appear in E3's Guide to Technical Services
  (User Guide). In addition, all office-level budget data is collected through the
  Office OYB Input Form.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
